COPY public.config (key, value, type, display_name, description) FROM stdin;
core:label_everything	No	boolean	Label all stock items?	Should stock labels be printed for all items in a delivery, including items that will not be checked individually during a stock take? (I.e. where the Unit for the item's stock type has the stock take method set to 'total quantity'.)
core:sessioncountup_print	Yes	boolean	Print countup sheets?	Should a counting-up sheet be printed when a session is closed?
register:max_transline_modify_age	0 days, 60 seconds	interval	Transaction line modify-in-place age limit	For how long after it is created can a transaction line be modified?  This applies both to adding additional items and voiding the line.
register:open_transaction_lock_after		interval	Lock open transactions after	Prohibit adding lines to an open transaction when it is older than this.  If blank, never lock.
register:open_transaction_lock_message		text	Locked transaction message	Display this message to the user when a transaction is locked.
register:sold_stock_removecode_id	sold	text	Code for sold stock	Stock usage code (RemoveCode.id) for stock that is sold
register:pullthru_stock_removecode_id	pullthru	text	Code for stock pulled through	Stock usage code (RemoveCode.id) for stock that is pulled through
register:drinkin_payment_method	CASH	text	Drink 'In' payment method	Code of payment method to use for the Drink 'In' function. If empty or invalid, the Drink 'In' function will be disabled.
register:defer_payment_method	CASH	text	Deferred payment method	Code of payment method to use when deferring a part-paid transaction that has some non-deferrable payments. The amount of the non-deferrable payments will be refunded, and a note will be printed with instructions describing how to apply the payment to the transaction in a future session.
register:payment_method_menu_after_void	No	boolean	Payment method menu after void	Automatically open the payment method menu after creating a transaction that voids lines from another transaction?
core:address	Eastnor Castle Deer Park\r\nEastnor HR8 1RQ	multiline text	Site address	Site address to be printed on receipts
core:clear_stockline_note_on_new_stock	Yes	boolean	Clear stock line note when changing stock	Should the note on a stock line be cleared automatically when a new stock item is put on sale on that stock line?
core:currency	Â£	text	Currency symbol	Currency symbol used throughout the system
core:sessiontotal_print	No	boolean	Print session totals?	Should session totals be printed after they have been confirmed?
core:sitename	EMF 2024	text	Site name	Site name to be printed on receipts
register:allow_mergetrans_with_payments	Yes	boolean	Allow merging transactions with payments	Allow transactions that have payments to be merged into other transactions? Only payment types that are explicitly marked 'mergeable' will be permitted; the presence of payments of other types will still prevent merging.
register:lock_after_nosale	Yes	boolean	Lock after No Sale	Lock the register after performing a No Sale operation?
register:open_transaction_warn_after	10 days	interval	Warn about open transactions after	When recalling an open transaction, warn the user if it is older than this.  If blank, never warn.
register:refund_help_text	If you are replacing items for a customer, enter the replacement items now BEFORE issuing a refund. Otherwise, press the appropriate payment key to issue a refund of that type.	text	Refund help text	Prompt displayed when a transaction has a negative balance and a refund may be due
core:checkdigit_on_usestock	Yes	boolean	Require check digits?	Should check digits be enforced when putting stock on sale?
core:checkdigit_print	Yes	boolean	Print check digits?	Should check digits be printed on stock labels?
core:telephone	1060	text	Telephone number	Telephone number to be printed on receipts
register:default_payment_method		text	Default payment method	Code of payment method to use when Cash/Enter is pressed on an open transaction. If empty or invalid, pressing Cash/Enter will always open the payment methods menu.
gtk:custom_css	/* This is the file 'custom.css' in the till user's home directory.\r\n   After updating it, install it using the following command:\r\n\r\n   runtill config -s gtk:custom_css <custom.css\r\n\r\n   N.B. when you do this, changes made using the web interface will be\r\n   lost.\r\n\r\n   You must restart the till for changes to take effect. If this config\r\n   option is set to invalid CSS, the till will fail to start.\r\n */\r\n\r\n/* Increase general button font size from 12px */\r\nbutton {\r\n    font-size: 16px;\r\n    text-shadow: none;\r\n    text-decoration: none;\r\n    min-height: 60px;\r\n}\r\n\r\n/* Increase number and cursor button font size from 18px */\r\n.numeric, .cursor, .key2x2, .key2x1, .payment {\r\n  font-size: 40px;\r\n}\r\n\r\nbutton:not(:active) {\r\n    transition: 100ms ease-in-out;\r\n}\r\n.linekey:active {\r\n    border-color: white;\r\n}\r\n\r\n.tshirt {\r\n    background-color: deepskyblue;\r\n    color: black;\r\n}\r\n\r\n.mate {\r\n    background-color: lighter(deepskyblue);\r\n    color: black;\r\n}\r\n\r\n.modifiers {\r\n  background-color: khaki;\r\n  color: black;\r\n}\r\n\r\n.modifiers label {\r\n  text-decoration-line: underline;\r\n}\r\n\r\n.spirits {\r\n  background-color: orange;\r\n  color: black;\r\n}\r\n\r\n.soft {\r\n  background-color: lightseagreen;\r\n  color: black;\r\n}\r\n\r\n.keg {\r\n/* Purple wanted */\r\n/* background-color: sandybrown; */\r\n  background-color: rgb(198, 63, 175);\r\n  color: white;\r\n}\r\n\r\n.keghalf {\r\n  background-color: lighter(rgb(198, 63, 175));\r\n  color: white;\r\n}\r\n\r\n.ale {\r\n/* Blue wanted */\r\n/* background-color: wheat; */\r\n  background-color: rgb(46, 23, 198);\r\n  color: white;\r\n}\r\n.alehalf {\r\n    background-color: lighter(rgb(46, 23, 198));\r\n/* rgb(66, 43, 198);*/\r\n  color: white;\r\n}\r\n\r\n.cider {\r\n  background-color: greenyellow;\r\n  color: black;\r\n}\r\n.ciderhalf {\r\n    background-color: lighter(greenyellow);\r\n  color: black;\r\n}\r\n\r\n.wine, .winemod {\r\n/* Brighter pink wanted */\r\n/* background-color: darksalmon; */\r\n  background-color: rgb(242, 43, 215);\r\n  color: black;\r\n}\r\n.winemod label {\r\n  text-decoration-line: underline;\r\n}\r\n\r\n.fridge {\r\n  background-color: powderblue;\r\n  color: black;\r\n}\r\n\r\n.snacks {\r\n/* White-ish wanted */\r\n/* background-color: coral; */\r\n  background-color: rgb(240, 242, 232);\r\n  color: black;\r\n}\r\n\r\n.linekey:active {\r\n  background-color: black;\r\n  color: white;\r\n}	multiline text	Custom CSS	Custom CSS for till when running with gtk
